import React from "react";
import "./style.css";
import { Link } from "react-router-dom";


function Nav() {
  return (
    <div>
    <nav className="navbar ">
      <li className="nav-item">
        <Link to="/" >

          Home
        </Link>
      </li>
      <li className="nav-item">
        <Link to="/newstore" >



          Add New Store
        </Link>
        </li>
        <li className="nav-item">
          <Link to="/login" >

      Login
        </Link>
      </li>
    </nav>
    <div className={"navbar-button"}><a style={{color: "white"}} href="/login">Login</a></div>
    </div>
  );
}

export default Nav;
